INSERT INTO `configuracao_site` VALUES (1,'b4653163-2ba9-41f8-87a5-b69ca715cfb3.png','Imobiliaria 7 Setembro','Temos como foco realizar o sonho que é a conquista do imóvel desejado pelo seu cliente.\n\nA Imobiliária 7 de Setembro fundada em agosto de 1989, tem como foco de seu trabalho, não apenas a satisfação das necessidades, com a visão de ser referência no seu ramo de negócio em informações e soluções, mas também buscar atender a expectativa na realização do sonho que é a conquista do imóvel desejado pelo seu cliente. A equipe, composta por seus profissionais é dedicada a oferecer os melhores serviços aos clientes. Além disso, a Imobiliária 7 de Setembro também presta assessoria em todos os processos da compra e venda de imóveis e também na assessoria em áreas rurais de agropastoril e florestal.','Temos profissionais dedicados a oferecer os melhores serviços a nossos clientes.','09:00','17:00','09:00','12:00',NULL,'Fechado','R. Dr. Lauro Azambuja, 288 - Centro, Guaíba - RS','atendimento@imobiliaria7setembro.com.br','(51) 3480-4066');
/*!40000 ALTER TABLE `configuracao_site` ENABLE KEYS */;
UNLOCK TABLES;

